import React from 'react';
import './App.css';
import {Header} from "./components/Header/Header";
import {Navigation} from "./components/Navigation/Navigation";
import {PostType, Profile} from "./components/Profile/Profile";
import {Dialogs, DialogsType} from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";


export type AppPropsType = {
    posts: Array<PostType>
    dialogs:Array<DialogsType>
}



const App = (props: AppPropsType) => {


    let DialogsComponent = () => <Dialogs dialogs={props.dialogs} messages={props.posts}/>
    let ProfileComponent = () => <Profile posts={props.posts}/>

    return (
        <BrowserRouter>
            <div className="App">
                <Header/>
                <Navigation/>
                <div className="app-wrapper-content">
                    <Route path='/dialogs' render={DialogsComponent}/>
                    <Route path="/dialogs" render={DialogsComponent}/>
                    <Route path="/profile" render={ProfileComponent}/>
                    {/*<Route path="/news" component={News}/>*/}
                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
